import React from 'react';

import Jumbotron from 'react-bootstrap/Jumbotron';

function App() {
  return (
    <div className="App">
      <p>hi</p>
      <Jumbotron>
        <h1>test</h1>
      </Jumbotron>
    </div>
  );
}

export default App;
